import "react-loader-spinner/dist/loader/css/react-spinner-loader.css";

function App() {
  return (
    <Router>
        <Switch>
          <Route path="/home">
            <Home/>
        </Route>
      <StyledContainer>
          <Route path="/signup">
            <Signup />
          </Route>    
       <Route path="/">
            <Login />
          </Route>
      </StyledContainer>
        </Switch>
    </Router>


  );
}

export default App;
